se metió.\nCumpleaños feliz te deseamos a tí. Cumpleaños amiguito, que los cumplas feliz.\n\nLa Muñequita\nTengo una muñeca vestida de azul. Patitas que bailan, faldita de tul. Cuenta con los manos cuenta con los pies, cuenta poco a poco desde el uno al diez.\nUno. Dos. Tres. Cuatro. Cinco. Seis. Siete. Ocho. Nueve. Diez.\nEncontró unas flores, se puso a sumar. Suma tu conmigo vamos a empezar: dos y dos son cuatro, cuatro y dos son seis, seis y dos son ocho y ocho dieciséis. \n\nDuérmete Pollito\nDuérmete pollito, duérmete mi amor. Duérmete pedazo de mi corazón.\nEste pollito mío que nació de noche quiere que lo lleve a pasear en coche.\nEste pollito mío que nació de día quiere que le cante esta melodía.\nEste pollito lindo se quiere dormir,  y el pícaro sueño no quiere venir.\nDuérmete pollito, duérmete mi amor duérmete pedazo de mi corazón.\n\nDe Colores\nDe colores, de colores se visten los campos en la primavera.\nDe colores, de colores son los pajaritos que vienen de afuera.\nDe colores, de colores es el arco iris que vemos lucir.\nY por eso los grandes amores de muchos colores me gustan a mi­. \nY por eso los grandes amores de muchos colores me gustan a mi­. \n\nTun Tun\nTun Tun ¿Quién es? Gente de paz. Ábrannos la puerta que ya es Navidad\nTun tun ¿Quién es? Gente de paz. Ábrannos la puerta que ya es Navidad\nQue vengan los amiguitos, queremos festejar con música y con dulces el año que vendrá.\n\n\n¡Suscríbete! Subscribe for new videos every week!   \n\n / @canticosworld  \n\nShop ► "},{"text":"https://shop.canticosworld.com/","navigationEndpoint":{"clickTrackingParams":"CIYDELsvGAAiEwjOnt_au7aHAxWR1j8EHcaSCeU=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbVBTTTRpWEtLU1pZckhuMWY0aWVWSUMtWGVyQXxBQ3Jtc0ttUy1zQ29YcXZ2OFItdVkzYlNENzVkMVZscU1TdGk3SFdlX2IxYmJ2Q1A4NTJudE9wTmRidG1ENUprdE1qS2ozbzZ4dTVBb2NRZUdaT3JWSEV5YWx5SVZfZ1ptV3BNX2R5RXdSZWwyc2E1bnRxblpqZw\u0026q=https%3A%2F%2Fsh
